import './LandingTab.css';

function LandingTab() {
  return (
    <div className="landingTab">Landing Tab
      <img className="landingRocket" src="rocket.png" alt=""></img>
      <img className="landingRocket" src="fire.png" alt=""></img>
      <img className="oregon" src="landingSite.jpg" alt=""></img>
    </div>
  )
}

export default LandingTab;
